    runs-on: ubuntu-latest
    container: tuxsuite/tuxsuite
    env:
      TUXSUITE_TOKEN: ${{ secrets.TUXSUITE_TOKEN }}
    steps:
    - uses: actions/checkout@v2
    - name: tuxsuite
      run: tuxsuite build-set --set-name allconfigs --json-out builds.json --tux-config tuxsuite/5.10.tux.yml --patch-series patches/5.10 || true
